import React, { useState } from 'react';
import AccountCircleIcon from '@mui/icons-material/AccountCircle';
import PersonAddIcon from '@mui/icons-material/PersonAdd';
import GroupAddIcon from '@mui/icons-material/GroupAdd';
import AddCircleIcon from '@mui/icons-material/AddCircle';
import NightlightIcon from '@mui/icons-material/Nightlight';
import SearchIcon from '@mui/icons-material/Search';
import { IconButton } from '@mui/material';
import "./style.css";
import ConversationItem from './ConversationItem';
import { useNavigate } from 'react-router-dom';
import { LightMode } from '@mui/icons-material';

function Sidebar() {

    const navigate = useNavigate();
    const [lightTheme, setLightTheme] = useState(true);
    const [conversations, setConversations] = useState([
        {
            name: "asdf",
            lastMessage: "qwerty",
            timeStamp: "now",
        },
        {
            name: "ghjk",
            lastMessage: "qwerty",
            timeStamp: "now",
        },
        {
            name: "poiu",
            lastMessage: "qwerty",
            timeStamp: "now",
        },
    ]);

    return (
        <div className={`sidebar-container ${lightTheme ? '' : 'dark'}`}>
            <div className='sidebar-header'>
                <div>
                    <IconButton title='Profile'>
                        <AccountCircleIcon />
                    </IconButton>
                </div>
                <div>
                    <IconButton onClick={() => { navigate('users') }} title='Users'>
                        <PersonAddIcon />
                    </IconButton>
                    <IconButton onClick={() => { navigate('groups') }} title='Groups'>
                        <GroupAddIcon />
                    </IconButton>
                    <IconButton onClick={() => { navigate('create-groups') }} title='Create Groups'>
                        <AddCircleIcon />
                    </IconButton>
                    <IconButton onClick={() => { setLightTheme((prevValue) => !prevValue) }} title='Theme'>
                        { lightTheme ? <NightlightIcon /> : <LightMode /> }
                    </IconButton>
                </div>
            </div>
            <div className='sidebar-search'>
                <IconButton>
                    <SearchIcon />
                </IconButton>
                <input type="text" placeholder='Search' className='search-box' />
            </div>
            <div className='sidebar-conversations'>
                {conversations.map((conversation) => {
                    return <ConversationItem props={conversation} key={conversation.name} />
                })}
            </div>
        </div>
    )
}

export default Sidebar;
